import axios from 'axios';
import '../cssfiles/Account.css'


export const depositMoney = async (depositData) => {
  try {
    const response = await axios.post("http://localhost:8080/login/deposit", depositData);
    return response.data;
  } catch (error) {
    console.error('Error depositing money:', error);
    return 'Error occurred while depositing money';
  }
};

export const withdrawMoney = async (withdrawData) => {
  try {
    const response = await axios.post("http://localhost/8080/login/withdrawal", withdrawData);
    return response.data;
  } catch (error) {
    console.error('Error withdrawing money:', error);
    return 'Error occurred while withdrawing money';
  }
};

export const transferMoney = async (transferData) => {
  try {
    const response = await axios.post("http://localhost/8080/", transferData);
    return response.data;
  } catch (error) {
    console.error('Error transferring money:', error);
    return 'Error occurred while transferring money';
  }
};

export const checkBalance = async (checkBalanceData) => {
  try {
    const response = await axios.post("http://localhost/8080/", checkBalanceData);
    return response.data;
  } catch (error) {
    console.error('Error checking balance:', error);
    return 'Error occurred while checking balance';
  }
};
